    data: |
      SELECT DISTINCT + col0 * col2 + + col1 * - ( col0 ) + col2 / col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q9685.out
    data: |
      3013
      6647
      86
